(6, '新手指南', 1008, '/about/details/id/44.html', '&lt;p&gt;11&lt;/p&gt;', '2019-06-19 15:39:16', 1, '20190616022345.png'),
(9, '公司简介', 1008, '/about/details/id/42.html', '&lt;ul class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: disc;&quot;&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;注册时无法收到手机短信验证码？&lt;/span&gt;&lt;/strong&gt;&lt;br/&gt;&lt;span style=&quot;font-size:12px&quot;&gt;短信验证系统由第三方提供，可能存在延迟，请您耐心等待。如超过60秒仍未收到，请重新验证。若多次操作后仍未收到短信验证码，请联系在线客服及时处理。&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;ul class=&quot; list-paddingleft-2&quot; style=&quot;list-style-type: disc;&quot;&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;实名认证可以使用护照号、军官证号吗？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;不可以。您只能填写中国大陆居民18位身份证号码，暂不支持护照或其他证件号码。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;充值之后没有投资行为可以直接提现吗？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;不可以。为防止洗黑钱及恶意套取公司推广奖励的情况出现，所有充值的资金必须在购买产品且正常到期后方可申请提现。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;账户名可以更改吗？&lt;/span&gt;&lt;/strong&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;不可以。已注册的账户名是唯一的，注册成功后无法更改。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;账户充值需手续费吗？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;账户充值不收取任何费用。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;认证成功后，身份证号码可以更换吗？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;不可以。为保障投资者账号及资金安全，实名认证通过后身份证信息无法修改。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;可以绑定多张银行卡吗？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;不可以。每个账户只能绑定一张银行卡用以提现。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;实名认证通不过该怎么办？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;1、请核对真实姓名与身份证号是否匹配；&lt;br/&gt;2、请核对真实姓名是否输入正确；&lt;br/&gt;3、请核对身份证号是否输入正确；&lt;br/&gt;4、在确认信息无误的情况下，若仍无法验证通过，请联系在线客服。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;银行卡认证失败该怎么办？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;1、请核对开户名是否与真实姓名一致；&lt;br/&gt;2、请核对开户名与银行卡号是否匹配；&lt;br/&gt;3、请核对开户行、支行名称是否填写正确；&lt;br/&gt;4、请核对银行卡认证金额是否输入正确。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;充值金额是否有上限？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;充值无金额限制。可充值金额取决于您绑卡银行的支付限额标准，&lt;span style=&quot;font-size: 12px;&quot;&gt;详情请咨询银行客服&lt;/span&gt;。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;是否支持信用卡充值？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;可以使用信用卡支付。&lt;span style=&quot;font-size: 12px;&quot;&gt;可充值金额取决于您的信用卡额度及单笔支付限额，详情请咨询银行客服。&lt;/span&gt;&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;提现多长时间可以到账？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;通常，提现申请到账时间为30分钟内，繁忙时段可能延长至2小时。如超过2小时仍未到账，请联系在线客服及时处理。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;账户提现收取手续费吗？&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size:12px&quot;&gt;每日可免费申请提现3次，超过次数的将收取单笔提现金额0.2%的手续费。&lt;/span&gt;&lt;br/&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&lt;strong style=&quot;padding: 0px; margin: 0px;&quot;&gt;&lt;span style=&quot;col:#c01920;font-size:12px&quot;&gt;同一身份证信息可以注册多个账户吗？&lt;/span&gt;&lt;/strong&gt;&lt;br/&gt;&lt;span style=&quot;font-size:12px&quot;&gt;不可以。同一身份证信息只能实名注册一个会员账户。如发现使用同一身份证信息实名多个会员账户的，将无条件永久冻结账户及账户内的所有资产，所造成的一切经济损失由个人承担。&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2019-06-19 15:39:27', 1, '20190616022620.png'),
(11, '微信充值步骤', 1007, '', '&lt;p&gt;&lt;span style=&quot;col: rgb(255, 0, 0);&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;col: rgb(255, 0, 0);&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;温馨提示：请先在充值页面截屏保存微信充值二维码，再打开微信APP进行操作。&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;col: rgb(255, 0, 0);&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;img src=&quot;/Public/uploads/article/20190615/1560612896544007.jpg&quot; title=&quot;1560612896544007.jpg&quot; alt=&quot;微信支付流程.jpg&quot;/&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2020-09-18 20:13:52', 0, '20190615233501.jpg'),
(19, '支付宝充值步骤', 1007, '', '&lt;p style=&quot;white-space: nmal;&quot;&gt;&lt;span style=&quot;col: rgb(255, 0, 0);&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;white-space: nmal;&quot;&gt;&lt;span style=&quot;col: rgb(255, 0, 0);&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;注意：请先在充值页面截屏保存支付宝二维码，再打开支付宝APP进行操作。&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;col: rgb(255, 0, 0);&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;img src=&quot;/Public/uploads/article/20190615/1560612748161197.jpg&quot; title=&quot;1560612748161197.jpg&quot; alt=&quot;支付宝支付流程.jpg&quot;/&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2020-09-18 20:13:40', 0, '20190615233117.jpg'),
(24, '会员等级与奖励', 1007, '', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img src=&quot;/Public/uploads/article/20190619/1560936878796819.png&quot; title=&quot;1560936878796819.png&quot; alt=&quot;VIP及推广奖励.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1、累计投资金额或团队总业绩达到上述条件时，将自动晋升为相应等级的VIP会员，即刻享受更高收益。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2、额外赠送的投资收益，适用于您成为VIP会员后购买的所有产品，在产品原有收益率基础上增加相应的比例，直接计入您的投资收益。在此之前购买的产品，不会产生任何变化。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3、VIP会员尊享VIP专区产品购买特权，不同等级VIP会员可以购买对应等级的专属产品。VIP4会员可购买专区的所有产品，并享有7*24小时个人专属理财客服坐席。&lt;/span&gt;&lt;/p&gt;', '2019-06-19 17:36:59', 1, '20190615231041.jpg'),
(25, '企业资质', 1007, '', '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560662437123570.jpg&quot; title=&quot;1560662437123570.jpg&quot; alt=&quot;注册证明长图.jpg&quot;/&gt;&lt;/p&gt;', '2020-09-19 10:33:30', 0, '20190616132050.png'),
(29, '在线客服', 1008, '', '&lt;p&gt;1&lt;br/&gt;&lt;/p&gt;', '2019-06-16 22:14:11', 1, '20190615221924.png'),
(42, '公司简介', 1007, '', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center; line-height: 1.5em;&quot;&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560660940719577.png&quot; title=&quot;1560660940719577.png&quot; alt=&quot;介绍图.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.5em;&quot;&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560661458585232.png&quot; title=&quot;1560661458585232.png&quot; alt=&quot;1560661458585232.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&amp;nbsp;德祥地产集团有限公司为一家以香港为基地之公司，其股份于1994年在香港联合交易所有限公司主板上市（股份代号:199）。德祥地产主要于澳门、中国、香港、加拿大及英国从事物业发展及投资，于中国、香港及加拿大从事发展、投资及营运酒店及消闲业务，证券投资及提供贷款融资服务。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.5em;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 就财资及金融管理业务而言，我们从事以上市公司证券为主的证券投资交易；我们亦有提供贷款融资服务及综合金融服务，此业务能补足物业发展及投资核心业务。我们目标在主要业务中建立多元化的金融投资组合，以维系集团的长远发展，并为我们的投资者及股东争取最大回报。&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.5em;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560661458585232.png&quot; title=&quot;1560661458585232.png&quot; alt=&quot;1560661458585232.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&amp;nbsp; 德祥金融集团成立于德祥地产集团内部，于2016年7月开始独立运营。项目一期已于2019年5月初完成，共投资各类项目22个，累计投资金额近2.93亿元，为广大投资者创利超5700万元。项目二期在广东省政府的支持下，与广州威福科技有限公司达成战略合作伙伴关系，并于2019年6月19日正式启动。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.5em;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; 德祥金融联合各类大型的金融机构，深度挖掘安全的金融资产，为用户提供安全、多元的投资理财产品和定制化的金融服务，打造更契合用户自身需求的财富管理方案。我们将人文情怀融入金融服务之中，为用户创造更多价值，为社会营造诚信健康的金融环境，有效推动普惠金融发展。&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2019-06-19 17:16:30', 0, '20190616160507.png'),
(31, '风险控制', 1007, '', '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560697208100018.png&quot; title=&quot;1560697208100018.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;strong&gt;资金保障&lt;/strong&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;A：第三方担保&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; 投资的每个项目均由平安财产担保公司提供担保，确保投资者本息安全和资金按时回笼，担保机构为其保理的每一个产品提供保本连带责任担保，必要时将进行全额赔付。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;B：专业第三方托管的保证金账户&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; 担保机构将提前向本集团缴存担保总额100%的保证金，保证金由第三方银行托管，为所有投资者提供保障，保证所有投资款项的足额偿还能力。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;C：第三方支付，不设资金池&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; 投资者的资金往来、沉淀资金均由第三方支付在线管理，实现用户资金与平台自有资金完全隔离，充分保障投资者的资金安全。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;D：资金上保险&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; 集团与平安财产担保公司达成战略合作，平安财产担保公司为用户资金安全承担保险责任。用户在德祥金融的充值、投资、提现、赎回等交易过程中，出现资金损失将由平安财产担保公司全额赔付，对于投资者而言，没有任何风险。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560697215125312.png&quot; title=&quot;1560697215125312.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;strong&gt;技术保障&lt;/strong&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;A：数据安全&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; 德祥金融专业投资技术团队出自平安集团、百度科技、阿里集团，在信息安全和数据安全方面有着非常丰富的经验，让您享受银行级别的安全保障，确保交易数据安全。&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;B：信息安全&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; 投资用户的所有重要个人信息都经过国际领先的SHA1及AES算法加密处理，防止内部工作过程中泄密，确保客户信息的私密和安全。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;C：通讯安全&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; 德祥金融采用国际上通用的基于SSL证书的安全传输模块，用户与投资平台之间的交易数据会经过256位沃通SSL证书加密，全面保护投资者的信息安全。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560697225976606.png&quot; title=&quot;1560697225976606.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;strong&gt;法律保障&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;德祥金融联合康德明律师事务所（百慕达）、姚黎李律师行（香港）、张叶司徒陈律师事务所（香港）、梁瀚民大律师（澳门）和德勤 ‧ 关黄陈方会计师事务所签订专业服务协议，制定了完备的法律意见书和投资协议，确保平台交易100%的合法合规。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2019-06-20 02:12:39', 1, '20190615232643.jpg'),
