(34, '常见问题', 1, '', '&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;如何注册账号？&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;点击右下角“我的”-“注册账号”进入注册页面，填写相关信息完成注册。“推荐人ID”为必填项，请联系您的推荐人获取4位数字的推广ID号。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;strong&gt;&amp;nbsp;注册时无法收到手机短信验证码？&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;请核对您输入的手机号码是否正确。短信验证系统由第三方提供，可能存在延迟，请您耐心等待。如超过60秒仍未收到，请重新验证。若多次操作后仍未收到短信验证码，请联系在线客服及时处理。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;实名认证可以使用护照号、军官证号吗？&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;不可以。请您填写中国大陆居民18位身份证号码，暂不支持护照或其他证件号码。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;充值之后没有投资行为可以直接提现吗？&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;不可以。为防止洗黑钱及恶意套取公司推广奖励的情况出现，所有充值的资金必须在购买产品且正常到期后方可申请提现。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;账户名可以更改吗？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;不可以。已注册的账户名是唯一的，注册成功后无法更改。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;在德祥金融投资理财会产生费用吗？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;您无需承担任何费用。注册账号是免费的，充值和提现（仅限每日第一笔提现）均为零手续费，没有其他任何杂项费用。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;认证成功后，身份证号码可以更换吗？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;不可以。为保障投资者账号及资金安全，实名认证通过后身份证信息将无法修改。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;可以绑定多张银行卡吗？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;不可以。每个账户只能绑定一张银行卡用以提现。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;实名认证通不过该怎么办？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1、请核对真实姓名与身份证号是否匹配；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2、请核对真实姓名是否输入正确；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3、请核对身份证号是否输入正确；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4、在确认信息无误的情况下，若仍无法验证通过，请联系在线客服。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;银行卡认证失败该怎么办？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1、请核对开户名是否与真实姓名一致；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2、请核对开户名与银行卡号是否匹配；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3、请核对开户行、支行名称是否填写正确；&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4、请核对银行卡认证金额是否输入正确。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5、在确认信息无误的情况下，若仍无法验证通过，请联系在线客服。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;充值金额是否有上限？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;充值无金额上限。最低100元起投，且只接受100元的整数倍充值。可充值金额上限取决于您绑卡银行的支付限额标准，详情请咨询在线客服或拨打银行客服电话查询。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;是否支持信用卡充值？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;可以使用信用卡支付。可充值金额取决于您的信用卡可用额度及单笔支付限额，详情请咨询在线客服或拨打银行客服电话查询。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;提现多长时间可以到账？&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;每日可提现的时间段为08:00-18:00。提现申请到账时间通常为30分钟内，繁忙时段可能延长至2小时。如超过2小时仍未到账，请联系在线客服及时处理。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;每天可以免费提现几次？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;每日可免费申请提现 1 次，超过次数的将收取单笔提现金额 3‰ （千分之三）的手续费。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://www.ttww998.cn/Public/uploads/article/20190618/1560834391269335.png&quot; title=&quot;1560834391269335.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;strong&gt;同一身份证信息可以注册多个账户吗？&lt;/strong&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;不可以。同一身份证信息只能实名注册一个会员账户。如发现使用同一身份证信息实名多个会员账户的，将无条件永久冻结账户及账户内的所有资产，所造成的一切经济损失由个人承担。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;', '2019-06-19 17:06:56', 1, '20190531152409.png'),
(35, 'APP下载', 1, 'http://h6n3.rf.h55gz.cn/KnBpH4', '', '2019-06-19 17:07:11', 1, '20190615221058.png'),
(36, '使用手机银行转账至对公账户加赠充值金额的2‰', 8, '/about/details/id/39.html', '&lt;p&gt;1&lt;/p&gt;', '2019-06-15 23:27:40', 1, '20190608210654.png'),
(37, '余额宝', 1008, '/about/details/id/43.html', '&lt;p&gt;11&lt;/p&gt;', '2019-06-16 22:54:11', 1, '20190616121130.png'),
(43, '余额宝', 1007, '', '&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560663178456997.png&quot; title=&quot;1560663178456997.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; 余额宝介绍&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;余额宝是德祥金融最新推出的收益版块，让您的投资更省心更便捷。您只需将每日收益的小额资金从账户余额中转入到余额宝中，即可坐享每日收益。余额宝是复利的，每日收益会计入已确认金额，用来计算次日收益，日收益率为0.8%，最低转入金额为100元，转入的金额在转入24小时后即可产生收益。余额宝中的资金可以随时转入转出，不受任何限制。&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; col: rgb(255, 0, 0);&quot;&gt;&lt;strong&gt;例&lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;：余额宝中有1000元已确认金额，日收益率为0.8%，那么您的当日收益为：&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1000*0.8%=8（元）&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560663185554679.png&quot; title=&quot;1560663185554679.png&quot; alt=&quot;蓝钻.png&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; 如何充分利用余额宝功能&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;通过余额宝获取的收益将在到期后自动返还到您的账户余额中，您可以选择复投至余额宝中，待余额宝账户余额累积到一定金额时，转出至账户余额再购买相应的小额理财产品，充分利用账户内的闲散小额资金，实现收益最大化。您也可以将其它的闲散小额资金充值放进余额宝中，直接赚取收益，积少成多，涓流成河。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img src=&quot;/Public/uploads/article/20190619/1560930031882323.png&quot; title=&quot;1560930031882323.png&quot; alt=&quot;余额宝.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2019-06-19 17:38:41', 0, '20190616133349.png'),
(44, '新手指南', 1007, '', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560671576250014.png&quot; title=&quot;1560671576250014.png&quot; alt=&quot;蓝钻.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;充值与提现&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;strong style=&quot;font-size: 14px;&quot;&gt;1、充值&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;①&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 您可在底栏“我的”-“充值”中申请充值。充值有3种方式：支付宝支付、微信支付、手机银行（网上银行）转账。三种方式的具体操作方法，请移步至“发现”-“最新资讯”中查看“支付方式”图文教程。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;②&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 您可以在任意时间点进行充值，单笔充值的上限金额，取决于您绑卡银行或三方支付平台的限额标准，详情请咨询所属银行或三方支付平台客服。需要提醒您注意的是，如使用手机银行（网上银行）转账至企业对公账户，请使用“实时转账”方式，且单笔转账金额&lt;strong&gt;不超过5万元&lt;/strong&gt;，以保证实时到账的时效。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;③&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 使用手机银行（网上银行）转账至企业对公账户方式充值的，&lt;strong&gt;赠送充值金额的2‰（千分之二）&lt;/strong&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;④&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 受网络原因或银行与第三方支付机构的影响，充值可能出现自动入账延迟的现象，您可以联系在线客服为您人工处理。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &lt;strong&gt;2、提现&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;①&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 您可在底栏“我的”-“提现”中申请提现。每日可提现的时间段为&lt;strong&gt;08:00-18:00&lt;/strong&gt;，节假日照常工作，全年无休。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;②&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 每日可免费申请提现 &lt;strong&gt;1 &lt;/strong&gt;次，超过次数的将收取单笔提现金额&lt;strong&gt;3‰（千分之三）&lt;/strong&gt;的手续费。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;③&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 提现申请到账时间为30分钟左右，繁忙时段可能延长至2小时。如超过2小时仍未到账，请联系在线客服处理。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong style=&quot;white-space: nmal;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;④&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;申请提现必须先完善银行卡信息，请在“我的”-&amp;quot;银行卡绑定“中填写银行卡相关信息，提醒您注意的是，&lt;strong&gt;请预留完整的银行卡开户行信息&lt;/strong&gt;（例如：中国建设银行广州南沙湾支行），以避免出现因开户行信息不完整造成到账延迟的现象。&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560671576250014.png&quot; title=&quot;1560671576250014.png&quot; alt=&quot;蓝钻.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;分区理财介绍&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;德祥金融致力于为用户提供安全、多元的投资理财产品，目前设立有“新客专享区”、“一带一路专区”、“天使投资专区”、“股权众筹专区”、“VIP尊享专区”、“时时返福利区”共6个理财产品专区，您可点击底栏“投资”进入投资专区列表，每个专区项目对应不同的投资收益与投资周期，请您根据个人的预期收益要求及资金状况，合理安排，理性投资。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;“VIP尊享专区”和“时时返福利区”属于高级会员区，购买这两个专区的产品，需&lt;strong&gt;同时满足&lt;/strong&gt;以下两个条件：&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;① &lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;会员等级达到“VIP1”或以上。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;② &lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;账户积分不少于10000分。&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560671576250014.png&quot; title=&quot;1560671576250014.png&quot; alt=&quot;蓝钻.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;VIP等级与奖励&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;德祥金融诚邀您加入VIP用户俱乐部，每一位尊贵的VIP会员都将享有以下特权：&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;①&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 专属收益进阶加成（最高至&lt;strong&gt;0.26%&lt;/strong&gt;）&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;②&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; VIP专区专属理财产品&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;③&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt; 个人专属理财客服坐席（限VIP4等级会员）&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;更多详情，请移步至“发现”-“最新资讯”中查看“会员等级与奖励”。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560671576250014.png&quot; title=&quot;1560671576250014.png&quot; alt=&quot;蓝钻.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;推广制度与奖励&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;strong style=&quot;white-space: nmal;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;①&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;目前设立&lt;strong&gt; 2 &lt;/strong&gt;级推广制度，&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;推广奖励是您的推广会员购买产品时您所得的佣金收入&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;：&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;直推第一级得&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5%，&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;直推第二级得&lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2%&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;。只要您的推广会员有投资行为（&lt;strong&gt;包括复投&lt;/strong&gt;），您均可获得每一次相应比例的奖励，由系统自动赠送到您的账户。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;举例说明&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;：您推荐了老王加入，老王是您的直推第一级会员，他购买了10000元的理财产品，您可以立即得到5%的推广奖励即500元，此笔奖励系统将实时返还至您的个人账户余额中。次日，老王推荐了老李加入，老李是您的直推第二级会员，老李投资了20000元，您可以再次得到2%的推广奖励即400元，此笔奖励系统也将实时返还至您的个人账户余额中。若老李再推荐老张加入，则老张的投资不再与您产生任何关系。&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;同时，老张的投资金额仍将计入您的团队推广业绩中，有助您通过团队推广方式获得VIP会员资格及相应积分。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;strong&gt;&lt;br/&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;② &lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;当您的团队推广总业绩满足一定条件时，您可以&lt;strong&gt;晋升为相应等级的VIP会员，并获赠相应数量的积&lt;/strong&gt;&lt;strong&gt;分&lt;/strong&gt;，享受与同等级VIP会员完全相同的权益，详情请移步至“发现”-“最新资讯”中查看“会员等级与奖励”。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;特别说明：若使用不当手段恶意套利，出现账户封停及资金冻结等情况，将由您自行承担所有经济损失。&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560671576250014.png&quot; title=&quot;1560671576250014.png&quot; alt=&quot;蓝钻.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;余额宝&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;余额宝灵活稳定，每天计算收益，可随时转入或转出。您可以充分利用余额宝功能管理每天的投资收益或其它闲散小额资金。请移步至首页的“余额宝”链接查看具体教程。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560671576250014.png&quot; title=&quot;1560671576250014.png&quot; alt=&quot;蓝钻.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;转盘抽奖&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;请移步至“发现”-“转盘抽奖”页面进入转盘抽奖。转盘抽奖每次消耗&amp;nbsp;&lt;strong&gt;100&amp;nbsp;&lt;/strong&gt;积分，每个账户每天可抽奖&lt;strong&gt;10 &lt;/strong&gt;次。奖品设置请参考页面活动说明，中奖后请直接联系在线客服兑换奖项。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/uploads/article/20190616/1560671576250014.png&quot; title=&quot;1560671576250014.png&quot; alt=&quot;蓝钻.png&quot; width=&quot;15&quot; height=&quot;15&quot;/&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;积分商城&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;请移步至“发现”-“积分商城”页面进入积分商城。为回报广大投资者，我们已与多个品牌供应商建立长期合作关系，您可以使用充值赠送的积分兑换商城内的实物，更多商品，请点击商城页面的“商品分类”查看。如有疑问，请联系在线客服。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;温馨提示：成功兑换的物品将于每月10-15日按照先后顺序统一安排发货。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2020-09-19 10:32:16', 1, '20190616155406.png');
