(1, '超级现金', 'SuperCash', 'QQ：28318138', '香港中环夏悫道12号美国银行中心30楼', '每天签到赠送1元现金。', '/mobile/kefu.html', 'http://4n86.talangidea.cn:81/KnBpH4', '', '', '', 300, 'aa#bb#cc\r\ndd#ee#ff\r\ngg#hh#ii', '&lt;p&gt;二、理财期未满，甲方不得擅自终止本协议，否则，乙方将取消为甲方的理财服务，甲方不享受任何理财收益，甲方投资时必须看清楚投资项目的一切事宜，按照公司要求进行投资，如有违反规定，甲方并承担由此所引起的一切损失。&lt;/p&gt;\r\n	    &lt;p&gt;三、理财方式以网络投资平台的形式进行合作。理财金由甲方帐户划转到乙方的综合理财帐户上进行具体的理财操作，由于甲方全权委托乙方理财，因此在股权，房地产土地，矿权，新能源，石油，等其它实业的投资风险由乙方承担，乙方首先要考虑资金的安全性，然后才考虑资金的收益。甲方不得以任何形式干预乙方的理财操作。收益是每天发放到甲方账户，待理财投资周期到日止，乙方应将甲方之理财本金划入其在乙方开立的存款帐户上。&lt;/p&gt;\r\n	    &lt;p&gt;四、乙方对甲方投资资金负有控制风险的责任，必须勤勉尽责。如果投资有亏损情况，则无论亏损大小由乙方承担全部损失，按合同承诺付款给甲方。如果乙方出现违约将由担保方丙方履行承诺付款给甲方。&lt;/p&gt;\r\n	    &lt;p&gt;五、保密义务 甲乙双方对其通过接触和通过其他渠道得知的有关各方的商业机密等严格保密，对所有资料严格保密，不得向任何其他人员及机构透露。个人的信息。&lt;/p&gt;\r\n	    &lt;p&gt;六、合同生效&lt;/p&gt;\r\n	    &lt;p&gt;1、本协议经投资人通过投资平台点击确认投资后自动生成并签订，本协议自生成时生效。&lt;/p&gt;\r\n	    &lt;p&gt;2、本协议履行期间，各方如发生争议或者纠纷，应友好协商解决；如协商不成，任何一方有权向乙方所在地人民法院起诉。&lt;/p&gt;\r\n	    &lt;p&gt;3、本协议采用电子文本形式制成，各方均认可该形式的法律效力。&lt;/p&gt;\r\n	    &lt;p&gt;七、理财协议一式三份，乙方一份，甲方一份，丙方一份，具有同等法律效力。&lt;/p&gt;', '请复制收款人、收款账号进行网银转账，转账附言中请备注您的手机号码。转账成功后请联系在线客服，祝您投资愉快！', '建设银行', '李德清', '6217002980110006256', 1, '', '20190618155903.png', 0, '', '20190617225645.png', 0, 0, '/Public/uploads/activity.png', 0, 1, 0, 1, 'two', '无', '德祥金融集团', '', '', '8,23', '1', '0.003');
