INSERT INTO `item` (`id`, `title`, `desc`, `img`, `total`, `rate`, `percent`, `day`, `type`, `min`, `max`, `num`, `guarantee`, `limit`, `content`, `time`, `sort`, `frbl`, `red`, `class`) VALUES
(47, '激活账号基石', '', '20200918210325.png', '10000.00', '0.00', '17.00', 100000, 5, '298.00', '498.00', 1, '超级现金', 0, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;该项目地处肯尼亚涅里郡，全长约37公里，距离在建的乡村公路163项目约20公里。业主为肯尼亚政府，合同工期30个月，质保期12个月，运营期36个月。主要施工内容为升级现有土路为沥青混凝土道路，其中行车道宽6米，两侧路肩宽0.5米。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;该项目是中国电建加强海外项目集群化管理、实行区域资源深度整合的成果。项目建成后，将极大改善该区域的交通状况，为当地居民提供便捷的出行路线，有助于改善当地民生，促进当地经济发展。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2020-09-17 21:59:00', 1, '0.00', '0.00', '3'),
(56, '社群共识粉丝', '', '20190619104055.jpg', '8465.00', '0.00', '31.50', 100000, 5, '3300.00', '5000.00', 1, '中国平安保险（集团）股份有限公司', 0, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;该项目建设地点为尼泊尔以下地区：Bharatpur, Dhading, Hetauda, Kavre, Lagankhel,Nuwakot, Palung, Ramechhap, Dolakha, Sindhupalchok，工程的主要内容为完成33/11kV, 3MVA 变电站1座，6/8MVA 变电站10座，10/13.3/16.6MVA变电站1座，20/24MVA 变电站1座，以及配套总长度约226公里的33kV 输配电线路，工程范围包括设计、供货、运输、安装、测试和试运行。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;本项目是森源电气抓住国家“一带一路”发展机遇，贯彻走出去发展战略和“大电气”发展战略的重要成果，展示了中国企业在国际市场的竞争能力和输变配电工程总包业务方面的国际品牌形象，标志着内内企业在国际市场开拓方面实现了新的跨越；且本次项目是国内企业第一个中标的国际输变电EPC工程项目，将对拓展国际输变配电工程总包业务产生积极的促进作用，也可为后续海外EPC总包项目的开拓和实施提供更多的国际市场经验。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2019-03-19 21:56:39', 3, '0.00', '0.00', '3'),
(52, '创世超级现金', '', '20200918210525.jpeg', '5606.00', '0.00', '16.71', 100000, 5, '1000.00', '3000.00', 1, '中国平安保险（集团）股份有限公司', 0, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 葛洲坝集团于2018年6月签署了该园区可研、规划设计合同。通过该规划设计合同的执行，萨卡特卡斯州政府高度认可葛洲坝在园区建设、运维、招商等方面的综合实力。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;　　萨卡特卡斯州位于墨西哥中部，是矿产大州，白银储量丰富。近年来，萨卡特卡斯州政府通过借鉴周边地区的发展经验，确定了以制造业、信息产业为主的产业转型策略，并通过一系列政策大力吸引外国投资。该项目的开发和落地，对深化葛洲坝集团的企业转型、践行“一带一路”合作具有重要意义。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2019-03-18 22:34:10', 2, '0.00', '0.00', '3'),
(71, '节点矿业资本', '', '20190619112828.jpg', '22630.00', '0.00', '16.70', 100000, 5, '10000.00', '10000.00', 1, '中国平安保险（集团）股份有限公司', 0, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;大马城项目位于马来西亚首都吉隆坡的市中心，项目占地约200万平方米，根据马来西亚前政府规划，大马城项目建成后将成为吉隆坡最重要的交通枢纽和集金融、商业、文化、旅游、高级住宅于一体的国际经济中心。中国中铁签署项目恢复框架协议。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2019-06-19 11:10:47', 4, '0.00', '0.00', '3');
